//import { authRoles } from 'app/auth';
import i18next from 'i18next';
import en from './navigation-i18n/en';
i18next.addResourceBundle('en', 'navigation', en);
const navigationConfig = [
	{
		id: 'project-dashboard',
		title: 'Dashboards',
		translate: 'DASHBOARDS',
		type: 'item',
		icon: 'dashboard',
		url: '/apps/dashboards/project'

	},
	{
		id: 'project-GAES',
		title: 'Gestion GAES',
		translate: 'Gestion GAES',
		type: 'item',
		icon: 'dashboard',
		url: '/apps/dashboards/project'

	},
	{
		id: 'crearempresa',
		title: 'Creacion Empresa',
		type: 'shopping_cart',
		icon: 'school',
		url: '/apps/empresa'
	},

	{
		id: 'Gestionarempresa',
		title: 'Gestionar Empresa',
		translate: 'Gestionar Empresa',
		type: 'collapse',
		icon: 'dashboard',
		children: [
			{
				id: 'analytics-dashboard',
				title: 'Analytics',
				type: 'item',
				url: '/apps/dashboards/analytics'
			},
			{
				id: 'project-dashboard',
				title: 'Project',
				type: 'item',
				url: '/apps/dashboards/project'
			}
		]
		/* id: 'Gestionarempresa',
		title: 'Gestionar Empresa',
		type: 'item',
		icon: 'today',
		url: '/apps/academy/Course' */
	},

];

/*
[9:58 a. m., 19/11/2020] Giovannibogota: a) Avance en creación de tu empresa
[9:58 a. m., 19/11/2020] Giovannibogota: b) Numero de empresas creadas
[9:59 a. m., 19/11/2020] Giovannibogota: c) Avance gestión contable
[10:00 a. m., 19/11/2020] Giovannibogota: 2. Gestionar empresa
[10:00 a. m., 19/11/2020] Giovannibogota: 3. Gestión  Contable
[10:00 a. m., 19/11/2020] Giovannibogota: 4. Gestión Proveedores
*/

export default navigationConfig;
